import{_ as a,o as e,c as r,e as t}from"./app.4659d0e0.js";const p={},o=t('<h1 id="springboot框架-引入外部jar包" tabindex="-1"><a class="header-anchor" href="#springboot框架-引入外部jar包" aria-hidden="true">#</a> SpringBoot框架 - 引入外部Jar包</h1><p>转载自：https://blog.csdn.net/m0_67401746/article/details/124035099</p><blockquote><p>在项目中，有时候需要引入外部jar包，启动运行。有两种方式，一种是直接在项目中添加jar包，另一种是在本地maven仓库中添加jar包，然后在pom.xml文件中引入依赖。</p></blockquote><h2 id="第一种方式-在项目中添加jar包" tabindex="-1"><a class="header-anchor" href="#第一种方式-在项目中添加jar包" aria-hidden="true">#</a> 第一种方式：在项目中添加jar包</h2><p>step1：在src/main/resources下创建lib目录，然后将jar包放在该目录下</p><p>step2：然后在project structure中引入该lib</p><h2 id="第二种方式-在pom-xml文件中引入外部jar包" tabindex="-1"><a class="header-anchor" href="#第二种方式-在pom-xml文件中引入外部jar包" aria-hidden="true">#</a> 第二种方式：在pom.xml文件中引入外部jar包</h2><p>step1：通过命令行方式，在本地maven仓库中添加jar包</p><p>打开cmd，执行mvn命令</p><p><code>mvn install:install-file -DgroupId=com.awen.testjar -DartifactId=awen-testjar -Dversion=1.0 -Dpackaging=jar -Dfile=D:developawen-testjar.jar</code></p><p>DgroupId：建议为包路径</p><p>DartifactId：jar包名称</p><p>Dversion：jar包版本号</p><p>Dpackaging：jar</p><p>Dfile：本地jar包地址</p><p>step2：在pom.xml文件中引入该依赖</p><p>com.awen.testjar</p><p>awen-testjar</p><p>1.0</p>',19),n=[o];function s(i,c){return e(),r("div",null,n)}const l=a(p,[["render",s],["__file","index.html.vue"]]);export{l as default};
